import React from 'react';
import { pupData } from './pupData';

const PupCard = () => {
    return(
    <div class="single-player-card">
          <div class="header-info">
            <p class="pup-title">${pupData.name}</p>
            <p class="pup-number">#${pupData.id}</p>
          </div>
          <img src="{pupData.imageUrl}" alt="photo of ${pup.name} the puppy"/>
          <button class="detail-button" data-id={pupData.id}>See details</button>
          <button class="delete-button" data-id={pupData.id}>Remove from roster</button>
    </div>


    );
};

export default PupCard;
